#![no_main]
#![no_std]

mod startup;
pub mod pherepherial;
pub mod spi;
pub mod uart;
pub mod system;
pub mod display;
pub mod time;
pub mod adc;

struct Color {
    r: u8,
    g: u8,
    b: u8,
}

impl Color {
    fn to_u16(&self) -> u16 {
        let mut c = 0;
        c |= ((self.r >> 3) as u16) << 11;
        c |= ((self.g >> 2) as u16) << 5;
        c |= (self.b >> 3) as u16;
        c
    }
}


#[no_mangle]
pub fn main() {
    system::init();
    time::init();
	display::init();
	adc::init();
    //uart::init();

    let mut count: usize = 0;
	let mut adc_result = 0;

	display::set_window(0, 0, 128, 160);
	display::write(&IMAGE);

	let mut y_pos = 0u8;

    loop {
        time::delay_ms(50);
            
        let colors = [
            Color { r: 255, g: 0, b: 0},
            Color { r: 0, g: 255, b: 0},
            Color { r: 0, g: 0, b: 255},
        ];

        let color = colors[count % 3].to_u16();
        //count += 1;

        //display::fill(color);
        /*
        display::set_window(0, 0, 128, 160);
        
        for _ in 0..(128 * 160) {
            display::write(&color);
        }
		*/
		adc_result = adc::get();
		display::set_pixel((adc_result >> 5) as u8, y_pos, color);

		y_pos += 1;

		if y_pos > 160 {
			y_pos = 0;
		}
        //display::write(&IMAGE);
    }
}



